import React from "react";
import classes from "./UserList.module.css";


function UserList(props){
    console.log(props.data[0])

    return (
        <div className={classes.users}>
            <ul>
               if (props.data) {props.data.map((user) => {
                <li>{user.userName}</li>})}
            </ul>
        </div>
    )
}

export default UserList;
